import React, { useEffect, useState } from 'react';

const MyInfoPage = () => {
  const { userId } = useParams();
  const [userInfo, setUserInfo] = useState({});
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [showLogoutPopup, setShowLogoutPopup] = useState(false);
  const [showWithdrawPopup, setShowWithdrawPopup] = useState(false);

  useEffect(() => {
    async function fetchAuthcheck() {
      try {
        const response = await fetch(`http://localhost:3001/authcheck/${userId}`);
        if (response.ok) {
          const data = await response.json();
          if (data.isLogin) {
            setIsLoggedIn(true);
            fetchUserInfo(data.userId);
          } else {
            setIsLoggedIn(false);
          }
        } else {
          console.error('서버에서 로그인 상태를 확인하는 동안 오류 발생:', response.statusText);
        }
      } catch (error) {
        console.error('API 요청 오류:', error);
      }
    }
  
    fetchAuthcheck();
  }, []);  

  const fetchUserInfo = async (userId) => {
    try {
      const response = await fetch(`http://localhost:3001/myinfo/${userId}`);
      if (response.ok) {
        const data = await response.json();
        if (data.error) {
          console.log(data.error);
        } else {
          setUserInfo(data);
        }
      } else {
        console.error('서버에서 정보를 가져오기 오류:', response.statusText);
      }
    } catch (error) {
      console.error('API 요청 오류:', error);
    }
  };  

  const confirmLogout = () => {
    alert("로그아웃 되었습니다.");
    setShowLogoutPopup(false);
  };

  const confirmWithdraw = () => {
    alert("회원탈퇴 되었습니다.");
    setShowWithdrawPopup(false);
  };

  return (
    <div>
      <style>
        {`
          /* 스타일 코드 */
        `}
      </style>
      <h1>내 정보</h1>
      {isLoggedIn ? (
        <div>
          <table>
            <thead>
              <tr>
                <th>항목</th>
                <th>내용</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>이름</td>
                <td>{userInfo.name}</td>
              </tr>
              <tr>
                <td>아이디</td>
                <td>{userInfo.userId}</td>
              </tr>
              <tr>
                <td>비밀번호</td>
                <td>{userInfo.password}</td>
              </tr>
              <tr>
                <td>생년월일</td>
                <td>{userInfo.birthdate}</td>
              </tr>
              <tr>
                <td>이메일</td>
                <td>{userInfo.email}</td>
              </tr>
              <tr>
                <td>전화번호</td>
                <td>{userInfo.phone}</td>
              </tr>
            </tbody>
          </table>
          <div className="button_container">
            <button className="logout" 
            // onClick={handleLogout}
            >
              로그아웃
            </button>
            <button className="withdraw" 
            // onClick={handleWithdraw}
            >
              회원탈퇴
            </button>
          </div>
        </div>
      ) : (
        <div>
          <p>11로그인이 필요합니다.</p>
          {/* 로그인 버튼 또는 로그인 페이지로 이동하는 링크 추가 */}
        </div>
      )}

      {showLogoutPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmLogout}>확인</button>
              <button onClick={() => setShowLogoutPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}

      {showWithdrawPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmWithdraw}>확인</button>
              <button onClick={() => setShowWithdrawPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default MyInfoPage;
